// Home.tsx
import React from "react";
import "./styles.css"; // Ensure this is the correct path to your CSS file
import { useNavigate } from "react-router-dom"; // Import useNavigate hook for navigation

function Home() {
  const navigate = useNavigate();

  // Function to navigate to the login page
  const navigateToLogin = () => {
    navigate("/login"); // Update this path according to your route setup
  };

  return (
    <div className="home-container">
      <div className="content">
        <h1>Welcome to BMW Cars</h1>
        <button className="login-button" onClick={navigateToLogin}>
          Login
        </button>
      </div>
    </div>
  );
}

export default Home;
